import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/NewExpenses/NewExpense";

function App() {
  const expenseItems = [
    {
      id: "e1",
      amount: 94.12,
      title: "Car insurance",
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      amount: 92.34,
      title: "Paper",
      date: new Date(2021, 12, 12),
    },
    {
      id: "e3",
      amount: 54.27,
      title: "Soda",
      date: new Date(2019, 2, 1),
    },
  ];
  return <Expenses expenseItems={expenseItems} />;
}

export default App;
